DROP TABLE IF EXISTS `corporation`;
CREATE TABLE `corporation`  (
  `corporation_id` int(255) NOT NULL AUTO_INCREMENT COMMENT '公司id',
  `corporation_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公司名称',
  `is_visit` tinyint(2) NOT NULL COMMENT '是否拜访',
  `corporation_location` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公司区域',
  `corporation_address` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '公司地址',
  `corporation_bidding` tinyint(2) NOT NULL COMMENT '是否招投标',
  `corporation_actual_payment` double(255, 5) NOT NULL COMMENT '实缴数',
  `corporation_register` double(255, 5) NOT NULL COMMENT '注册数',
  `corporation_social_security_number` int(255) NOT NULL COMMENT '社保人数',
  `corporation_gxdq_date` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '高新到期时间',
  `corporation_rqdq_date` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '软企到期时间（空默认为无）',
  `corporation_ISO9001` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'ISO9001（date类型，可设多个）',
  `corporation_ISO20000` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'ISO20000（date类型，可设多个）',
  `corporation_ISO27000` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT 'ISO27000（date类型，可设多个）',
  `corporation_fivestar` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '五星售后（date类型，空为默认为无）',
  `corporation_combination` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '两化融合（空默认为无）',
  `corporation_jitc` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '贯标（date类型，空默认为无）',
  `corporation_supplement1` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '其它补充1',
  `corporation_supplement2` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '其他补充2',
  `corporation_website` int(255) NOT NULL COMMENT '网站数量',
  `corporation_applet` int(255) NOT NULL COMMENT '小程序数量',
  PRIMARY KEY (`corporation_id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

