-- ----------------------------
-- Records of lunbotu
-- ----------------------------
INSERT INTO `lunbotu` VALUES (16, 'data:image/jpeg;base64,', 1, '3月13日，上海市明园小安桥小区的居民接受核酸检测。  根据疫情防控统一部署，3月13日，位于上海市徐汇区中山西路的明园小安桥小区临时实施闭环管理。小区居民积极配合，有序进行核酸检测。  新华社记者 高峰 摄');
INSERT INTO `lunbotu` VALUES (17, 'data:image/jpeg;base64,', 1, '3月13日晚，北京2022年冬残奥会闭幕式在北京国家体育场举行。  这是闭幕式上的北京冬残奥会吉祥物“雪容融”。  新华社记者 吴壮 摄');
INSERT INTO `lunbotu` VALUES (18, 'data:image/jpeg;base64,', 1, '3月13日，在湖南省衡阳市常宁市板桥镇板桥村，藕农在采收莲藕。  天气回暖，湖南省衡阳市常宁市板桥镇板桥村莲藕种植基地的浅水藕迎来丰收，当地藕农抓紧有利时机采收莲藕，供应市场，田间一派忙碌景象。  新华社发（周秀鱼春 摄）');
INSERT INTO `lunbotu` VALUES (19, 'data:image/jpeg;base64,', 1, '3月13日，在广西柳州市柳东新区雒容镇坭桥村，村民在地里给刚种植的辣椒苗浇水。  随着天气回暖，人们抢抓农时开展农业生产，田间地头一片繁忙景象。  新华社发（黎寒池 摄）');
INSERT INTO `lunbotu` VALUES (21, 'data:image/jpeg;base64,', 1, '3月13日拍摄的东方梅园（无人机照片）。  近期，浙江省湖州市长兴县龙山街道东方梅园内2万多株梅花进入盛花期，吸引众多市民和游客前来赏梅踏青。  新华社记者 徐昱 摄');

