INSERT INTO `tuisong` VALUES (3, '香港特首视察屯门“围封强检”行动', '中新网香港3月14日电 香港特区行政长官林郑月娥13日视察屯门翠宁花园的“围封强检”行动，为参与行动的同事打气，并对他们无分彼此，纷纷走到前线执行抗疫工作，感到鼓舞。', '(抗击新冠肺炎)香港特首视察屯门“围封强检”行动  中新网香港3月14日电 香港特区行政长官林郑月娥13日视察屯门翠宁花园的“围封强检”行动，为参与行动的同事打气，并对他们无分彼此，纷纷走到前线执行抗疫工作，感到鼓舞。  特区政府13日下午起在屯门翠宁花园第3座进行“围封强检”行动，林郑月娥到场视察。她了解到，自第五波疫情以来，更多政策局及部门担负抗疫任务，动员各级公务员纷纷走到前线为市民服务。  据介绍，特区政府财经事务及库务局先后在12日和13日分别派出破产管理署和库务署牵头统筹和执行屯门翠宁花园内不同楼宇的“围封强检”行动，每次动员140至150人不等，参与职系众多，政务主任、律师、破产管理主任、会计主任、库务会计师、物业估价测量师、系统分析及程序编制主任、电脑操作员、物料供应主任，以及其他文职人员等。  “围封强检”行动是特区政府抗疫重要手段之一，自第五波疫情以来已进行超过200次。特区政府称，“围封强检”检测阳性比例极高，是聚焦资源于高风险地区、识别感染者进入社区隔离设施、减少家居或大厦内交叉感染风险的手段。  林郑月娥说，公务员是香港城市运作的重要支柱之一，面对严峻疫情，各级公务员都应把抗疫工作放在首位，部门之间无分彼此，众志成城，承担不同抗疫任务，充分发挥特区政府总动员抗击疫情的精神。她感谢居民和全港市民充分配合抗疫措施，深信在整个社会同心协力下，香港定能早日战胜疫情。(完)', '中国新闻网', '2022-03-14', 1, 'data:image/jpeg;base64,');
INSERT INTO `tuisong` VALUES (5, '火速集结连夜奋战—联通全力做好疫情防控通信保障', '3月13日，泉州市丰泽区确诊9例新冠肺炎病例，面对来势汹汹的新一轮新冠肺炎疫情，泉州联通党委高度重视，快速响应，迅速部署，立即组织人员第一时间奔赴抗“疫”第一线，发挥自身信息化优势，履行央企责任与担当。', '党委重视，快速部署。3月13日，泉州联通党委紧急召开疫情防控专项会议，成立泉州疫情防控应急保障机构，分设了总协调组、物资保障组、网络保障组等5个工作小组，进一步压实责任、细化分工，明确了各项保障措施。会议强调，一是要主动做好通信保障工作，二是要助力当地政府做好疫情防控工作，三是要主动做好员工安全管理，加强办公场所防控措施，做好物资盘点和发放工作。战疫先锋，彰显央企担当。3月13日下午，泉州联通第一时间派出保障支撑团队协助泉州市政府精准防“疫”，主动对接工信局及各街道，针对丰泽、鲤城各社区街道核酸检测工作，连夜派出党员先锋队、青年突击队共50余名队员，快速组织提供1000多台终端及600多张通信卡，助力泉州市全场景核酸检测信息系统使用培训工作顺利开展，极大提高了核酸检测工作效率。', '福建联通', '2022年03月14日 17:12', 0, 'data:image/jpeg;base64,');
INSERT INTO `tuisong` VALUES (6, '徐州鼓楼区九里街道：“敲门行动”护万家 拧紧疫情“防控阀”', '中国江苏网3月14日徐州讯（记者 彭颂珂 通讯员 王月蒙）疫情就是命令，防控就是责任。连日来，徐州市鼓楼区九里街道各级党组织300余名党员们在疫情防控一线亮身份、当先锋，在辖区内全范围开展“敲门行动”，通过“地毯式”排查、逐一登记返徐人员和居住人员信息，确保“不漏一户，不漏一人”，用实际行动拧紧疫情“防控阀”。', '中国江苏网3月14日徐州讯（记者 彭颂珂 通讯员 王月蒙）疫情就是命令，防控就是责任。连日来，徐州市鼓楼区九里街道各级党组织300余名党员们在疫情防控一线亮身份、当先锋，在辖区内全范围开展“敲门行动”，通过“地毯式”排查、逐一登记返徐人员和居住人员信息，确保“不漏一户，不漏一人”，用实际行动拧紧疫情“防控阀”。  　　党建引领，防控疫情践初心  　　针对当前疫情形势，九里街道采取干部包挂、科室包抓责任制，坚持“细分到楼、精确到人”原则，全体人员按楼栋分小组，地毯式、全覆盖摸排。200余名冬训党员志愿者、社区工作者、社区民警、下沉机关干部等深入社区，逐户敲门，将每家每户的疫苗接种、流动情况等防疫信息摸排清楚，重点排查3月6日以来涉疫地区返徐人员信息，对未报备人员当即补充登记并依照相关政策采取措施。截至目前，九里街道已完成13232户常住及流动人口疫情防控信息采集登记。  　　坚守岗位，防疫工作勇担当  　　疫情防控，就是与时间赛跑。九里街道统一调度协调，由班子成员带队，300余名防疫力量第一时间奔赴各个小区组成“敲门入户”工作队，采用“鼓楼区外来人员登记平台二维码”“网络+电话”“线下面对面”等方式组织引导居民进行登记，就近选择核酸采样点、发热门诊，用“大数据+网格化+铁脚板”筑牢基层防疫的坚强堡垒。街道纪工委组成督查小组，对摸排范围内的小区进行流动督查。通过一家家敲门，一次次询问，对摸排小组工作情况进行“拉网式”落实，让党旗在抗疫一线高高飘扬。  　　温馨宣传，立体防疫暖人心“这些工作人员真是太辛苦了，一遍遍地上门，一句句地劝说，很敬业，我们一定积极配合。”万科城社区居民黄正梅说。  　　九里街道利用微信、大屏、社区管家、公众号等宣传方式，建立全方位、立体化的宣传体系，引导居民规范疫情防控行为。“敲门行动”中通过现场宣传，引导居民对疫苗“应接尽接”。同时，叮嘱居民主动报告行程，增强自我防护意识，严格落实戴口罩、时刻保持一米线，少出行不聚集等防控措施，以实际行动筑牢抗击疫情的“铜墙铁壁”。', '新华报业网', '2022年03月14日', 1, 'data:image/jpeg;base64,');
INSERT INTO `tuisong` VALUES (7, '萌娃赞颂平凡英雄 用行动助力疫情防控', '红网时刻新闻3月14日讯（通讯员 熊佳佳）3月14日，长沙市天心区幼幼幼儿园开展“春风温暖拂大地，疫情防控我做起”主题教育活动，引导孩子们赞颂抗疫一线平凡英雄的同时，号召大家用行动助力疫情防控。', '当前疫情形势依然严峻，很多工作人员依旧奋战在防疫一线。活动中，孩子们根据父母、身边人的事迹，分享他们的故事。何姿颖小朋友说：“我妈妈是医生，疫情防控期间，他们一天要戴10小时以上的口罩、护目镜，脸上都被压出了很深的印子，但依然冲锋向前。”李浩铭小朋友向大家介绍：“小区被封闭时，很多社区工作人员每天到家里来巡查，上门为我们量体温，帮忙买水、买食物、取快递，每天熬夜到很晚，自己的家都没时间照顾。”活动中，孩子们用亲手制作的鲜花及一首《让爱传出去》了表达对医生、警察、社区工作人员的感谢与敬佩。  　　奋斗在一线的疫情防控人员用大爱给予了孩子们力量，对于萌娃来说，应该做些什么呢？活动最后，幼儿园老师向孩子们提出了三点具体要求：出门戴口罩、勤洗手、讲卫生。  　　据介绍，为切实保障广大幼儿、家长的身体健康和生命安全，幼幼幼儿园已对班级活动室、功能室、洗手间、走廊楼梯等部位进行了细致的消毒消杀，为幼儿园疫情防控工作提供了坚实的保障，并向广大幼儿家长发出了“口罩佩戴要正确”“进出校园要守规”“出省出市要申报”“疫苗接种要积极”“个人防护要加强”“卫生习惯要养成”六条倡议。', '红网', '2022年03月14日', 0, 'data:image/jpeg;base64,');
INSERT INTO `tuisong` VALUES (8, '天津出现疫情反弹，学校陆续停课，线上教学提上日程', '近段时间，国内部分地区出现疫情反弹，对大家的线下生活造成一定影响，为了做好疫情防控工作，许多人群高度聚集的场所被重点防控。比如电影院关门、饭店不允许堂食、KTV关门等等。  　　当然，学校自然也是重点防控的场所之一，毕竟学校的人群密度很大，如果出现确诊病例，那么对于全校师生的健康都可能造成威胁。  　　天津出现疫情反弹，学校陆续停课，线上教学提上日程  　　根据天津市卫健委官网公布的相关数据，3月12日，天津市新增17例本土病例，以及9例本土无症状感染者。防控形势较为严峻。', '为了做好疫情防控工作，有关部门制定了相应的举措积极应对，与此同时，部分区域的教育部门也发布了相关要求。于是不少学校陆陆续续宣布线下停课，避免造成人群聚集。 　　天津市这种做法无疑是明智的，根据吉林以及重庆的经验来看，这两地均在高校内发现了确诊病例，而且出现了一定范围的传播。所以，对于天津而言，当下对学校进行重点关注，谨慎对待是合情合理的。 　　而随着线下陆续停课之后，线上教学将成为后续一段时间的主要教学方式，高校学子将会在宿舍上课，而中小学生则将通过手机、平板或电脑等方式实现线上学习。 　　当然，线上教学有一定的弊端，比如老师不能实时监控课堂纪律，不能根据学生们的表现来判断授课效果，不能像线下那般频繁互动。 　　那么这就对学生们提出了更高要求。比如需要更加自律，确保能够全神贯注地听课；比如要养成预习的习惯，能够提前了解各章节的重难点；比如要按质按量完成老师布置的各项作业，确保所学知识能够得到及时巩固。 　　其实从2020年至今，我们已经具备了十分丰富的线上教学经验，对于老师们而言，已经有了相对成熟的教学方式。不过对于学生们而言，或许还需要一定的时间去适应，要尽快调整自己的状态。 　　当然，居家或在寝室线上学习并不意味着大家可以有更多的时间去玩游戏，这更像是对大家的一场考验。毕竟将来走向社会参加工作之后，同样没人管你，但是你将来的人生会怎样主要取决于你自己的努力和自律。 　　需要提醒大家的是，特殊时期，个人防护特别重要。就在最近，就发生了一起在街上行走，因为没有佩戴口罩而被感染的真实病例，所以大家千万不要因为嫌麻烦而不执行。当然，如果没什么事，能不出门最好。 　　最后用一句话和广大学子们共勉，你在线上教学期间付出了多少努力，将来恢复线下教学之后，你和别人的差距就会有多大。', '教育很有料', '2022年03月14日', 1, 'data:image/jpeg;base64,');

